CREATE TABLE IF NOT EXISTS Plant_Database (
    `Name` VARCHAR(25) CHARACTER SET utf8,
    `Min_Temp_F` INT,
    `Min_Temp_C` NUMERIC(13, 11),
    `Max_Temp_F` INT,
    `Max_Temp_C` NUMERIC(12, 10),
    `Lighting` VARCHAR(26) CHARACTER SET utf8,
    `Watering_Winter` VARCHAR(21) CHARACTER SET utf8,
    `Watering_Spring` VARCHAR(21) CHARACTER SET utf8,
    `Watering_Summer` VARCHAR(21) CHARACTER SET utf8,
    `Watering_Fall` VARCHAR(21) CHARACTER SET utf8,
    `Soil` VARCHAR(13) CHARACTER SET utf8,
    `Good_Humidity` VARCHAR(7) CHARACTER SET utf8,
    `Bad_Humidity` VARCHAR(6) CHARACTER SET utf8
);
